import "../Item/Item.css"

const Item = ({id, title, description, price, pictureUrl, stock}) => {
    return (
            <div className="cart">
                <img className="cart__image" src={pictureUrl} alt="Anillo Cómo Decírtelo Joyas" />
                <h3>{title}</h3>
                <h4>${price}</h4>
                <button>Ver Más</button>
            </div>      
    );
}

export default Item;
